        <div className="row my-1 text-capitalize text-center">
            <div className="col-10 mx-auto col-lg-2">
                <img src={image} style={{width:"5rem", height: ""}} className="img-fluid" alt="product"/>
            </div>
        </div>
    );
}

export default CartItem;
